import React from "react";
import "./MainPage.css";
import { Box } from "@mui/material";

const MainPage = () => {
  return <Box className="mainPage">
    <Box>상품 리스트</Box>
    <Box>북마크 리스트</Box>
  </Box>
};

export default MainPage;
